const favGener = "Horror";

const FavG = () => {
if (favGener === "Horror") {
		return (
            <Action />
           );
}
else if (favGener === "Adventure") {
	return (
            <Adventure />
           );
}
else {
	return(
		<Horror />
		);
}

};

const App = () => (
  <>
  <h1 className="style_css">Top Streaming On BookMyShow In 2021</h1>
  <FavG />
   </>
);

